import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props)
    let counter = 0;
  }
  handleClick() {
    this.setState();
  }

  render() {
    return(
      <div>
        <p>{this.state.count}</p>
        <button onClick= {() => {this.handleClick()}}>ねこ</button>
      </div>
    );
  }
}

export default App;
